     1         3.544907701811032d+0*erf(1.5591108358883013d+1*t5)
            t12 = 1.0d+0-4.275941461768073d-2*t11*t6
            t13 = param(12)
            t14 = rhoa**1.6666666666666669d+0
            t15 = 1/taua
